import { motion } from "framer-motion";
import "../../Styles/All.css";
const All: React.FC = () => {
  return (
    <div>
      <motion.div>
        <motion.div className="revenue-container">
          <motion></motion>
          <p style={{ fontSize: 30, marginTop: 0 }}>Revenue Flow</p>
          <div style={{ marginLeft: "auto" }}>View All &gt;</div>
          <motion.div>
            <div>2.5k$</div>
            <div>2.0k$</div>
            <div>1.5k$</div>
            <div>1k$</div>
            <div>0.5k$</div>
            <div>0$</div>
          </motion.div>
        </motion.div>
      </motion.div>
    </div>
  );
};

export default All;
